import React, { useState, useMemo, useEffect } from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import About from "./pages/About";
import "./styles/App.css";

function App() {
  return (
    <div>

        <Routes>
          <Route path="/about" element={<About/>}></Route>
        </Routes>

    </div>
  );
}

export default App;
